summary:
Civil Engineer with a master's degree in Structural Engineering and focus on:

- Structural Engineering;
- Static and dynamic numerical analysis (in particular the Finite Element Method);
- Structural design;
- Structural optimization;
- CAD drawing.

I finished my bachelor's degree in Civil Engineering with a thesis named Perdas de Protensão em Lajes Lisas com Cordoalhas Não Aderentes (Loss of Prestress in Slabs with Unbounded Cables), in which the evaluation of the tension's losses was exploited, especially the computations of such losses, helping in design of post-tensioning structures.

During my master's degree in Structural Engineering, I did research in the field of computational mechanics applied to Fracture Mechanics at LMCV (Laboratory of Computational Mechanics and Visualization - http://www.lmcv.ufc.br/). My master's thesis dealt with the analysis of cracking in quasi-brittle materials using using the Finite Element Method. In order to solve the resulting non-linear material damage evolution problem, interface elements featuring different types of cohesive-zone models were used.

Currently, I am trying to broaden my experiences by pursuing a job as an engineer. I have particular interest in structural engineering with focus on numerical modeling and design. However, I am also willing to explore other civil and mechanical engineering fields. As I have just arrived in the Netherlands, I am still not able to communicate in Dutch, but am more than willing to learn it.
